import React from 'react';
import AppHeader from '../app-header';
import SearchPanel from '../search-panel';
import PostStatusFilter from '../post-status-filter';
import PostList from '../post-list';
import PostAddForm from '../post-add-form';

import './app.css';

const App = () => {
    const data = [
        {label:'Сейчас я изучаю библиотеку на основе JavaScript -React', important :false ,id:'jhvh1'},
        {label:'I need a breack', important :true ,id:'jhvh2'},
        {label:'I need a work', important :false ,id:'jhvh3'}
    ]
    return(
        <div className='app'>
        <AppHeader/>
        <div className='search-panel d-flex'>
            <SearchPanel/>
            <PostStatusFilter/>
        </div>

        <PostList 
            post={data}
            onDelete={id => console.log(id)}/>
        <PostAddForm/>
        </div>
    )
}

export default App;
